import React from "react";

export default function SetAngle({angle,setAngle}) {
    return(
        <>
            <label className="form-label">Example range</label>
            <input type="number" value={angle} onChange={e => {setAngle(e.target.value)}}></input>
            <input type="range" min="0" max="360" className="form-range" id="customRange1"></input>
        </>
    )
}
